*Happy weekend!*

I have had a few people message me about the @merodacosmetics colour changing foundation, so thought I would share some more info - after placing a second order and this time bulk buying - I love it that much!! 

The foundation comes out white, and then when you rub it in, it blends to your skin tone. The main reason I wanted to try this was come summer time, I get freckles and a bit of colour and often change foundation - to match. @merodacosmetics means I use the same bottle all year round - no matter whether I have a slight tan or not. 

It's magic, I have no idea how it works, but it does!! 

Make up used here - 

@merodacosmetics foundation -
@bobbibrownuk pressed power and bronzer
@primark.beauty mascara - personally, I can use any mascara,I  so buy cheap.
@poundland brow wand - this is amazing, and for £1 - you can't go wrong!! 
@milkmakeup lip and cheek in 'Werk' - my fave! 

Have a lovely weekend 💗
